import styled from '@emotion/styled';

export const Ul = styled.ul`
  width: 200px;
  border: black solid 1px;
  border-radius: 15px;
`;

export const Li = styled.li`
  border: black solid 1px;
  padding: 20px;
  border-radius: 15px;
`;
